pragma solidity ^0.4.24;
import "../SharedContracts/VuupleAdmins.sol";
import "../SharedContracts/VuupleToken.sol";
// import "../../node_modules/openzeppelin-solidity/contracts/access/roles/MinterRole.sol";
import "./LenderRegistration.sol";
contract LenderFactory{
    VuupleAdmins private vuupleAdmin;
    VuupleToken private vuupleToken;
    uint public lenderIndex =0;


    // MinterRole private minters;

     mapping (address=>address) lendersToContracts;
    constructor( VuupleAdmins _adminAddress,  VuupleToken _vuupleToken ){
        vuupleAdmin =_adminAddress;
         vuupleToken=   _vuupleToken ;
// TODO: adding contract to minter group will be done monually on migration
        //vuupleToken.addMinter(this);
    }

 modifier isNewLender{
        require(lendersToContracts[msg.sender] == address(0));
        _;
    }
       function lenderRegister(uint256 _rentedStorage) public isNewLender  returns (bool) {
        /**VuupleAdmins _adminAddress , uint256 _renewalDate, uint256 _rentedStorage , VuupleToken _vuupleToken , _ */
        lendersToContracts[msg.sender] = new LenderRegistration(vuupleAdmin 
        ,    _rentedStorage , vuupleToken ,msg.sender);

        _addToMinerRole(lendersToContracts[msg.sender]);

          lenderIndex++;
        return true;
    }
    function getLenderContract(address lenderAddress) returns (address ) {
        return lendersToContracts[lenderAddress];
    }
    function _addToMinerRole(address contractAddress) internal returns (bool){
        vuupleToken.addMinter(contractAddress);
        return true;
    }


}
